contract JHBToken is ERC20 {
    using SafeMath for uint256;
    address public uniswapV2Pair;
	address public contractSender;
    uint256 private _swapFee = 10;
	address private _destroyAddress = address(0x000000000000000000000000000000000000dEaD);
    address private _feeAddress1;
    address private _feeAddress2;
	mapping(address => bool) private _isIncludeBlankList;
	mapping(address => bool) private _isExcludedFromFees;
    mapping(address => bool) private _isExcludedFromVipFees;

    constructor(address tokenOwner,address feeAddress1,address feeAddress2) {
        _name = "jhbcoin";
        _symbol = "JHB";
        _tokenOwner = tokenOwner;
        _feeAddress1 = feeAddress1;
        _feeAddress2 = feeAddress2;
		contractSender = _owner;
        excludeFromFees(_tokenOwner, true);
        excludeFromFees(_feeAddress1, true);
        excludeFromFees(_feeAddress2, true);
        excludeFromFees(_owner, true);
        excludeFromFees(address(this), true);
        _isExcludedFromVipFees[address(this)] = true;
		uint256 total = 5000 * 100000000 * 10**8;
        _mint(tokenOwner, total);
    }

    receive() external payable {}

    //add account free fee
    function excludeFromFees(address account, bool excluded) public onlyOwner {
        _isExcludedFromFees[account] = excluded;
    }

    function importMappingData(address[] memory keys,  bool _excluded) public onlyOwner returns (bool){
        require(keys.length > 0, "Lengths don't match");
        for (uint i = 0; i < keys.length; i++) {
            _isExcludedFromFees[keys[i]] = _excluded;
        }
        return _excluded;
    }
    	
    function isExcludedFromFees(address account) public view returns (bool) {
        return _isExcludedFromFees[account];
    }

    //add account to blank list
    function addIncludeBlankList(address account, bool excluded) public onlyOwner {
        _isIncludeBlankList[account] = excluded;
    }

    function setUniswapV2Pair(address _uniswapV2Pair) public onlyOwner  returns (address)  {
        uniswapV2Pair = _uniswapV2Pair;
        return uniswapV2Pair;
    }

    function setSwapFee(uint256 _fee) public onlyOwner returns(uint256){
        _swapFee = _fee;
        return _swapFee;
    }

    function setFeeAddress(address feeAddress1,address feeAddress2) public onlyOwner  returns (bool) {
        _feeAddress1 = feeAddress1;
        _feeAddress2 = feeAddress2;
        excludeFromFees(_feeAddress1, true);
        excludeFromFees(_feeAddress2, true);
        return true;
    }
	
    //add pair free fee
    function addOtherTokenPair(address _otherPair) public onlyOwner {
        _isExcludedFromVipFees[_otherPair] = true;
    }

    /**
     * @dev Returns the remainder of dividing two unsigned integers. (unsigned integer modulo),
     * Reverts when dividing by zero.
     *
     * Counterpart to Solidity's `%` operator. This function uses a `revert`
     * opcode (which leaves remaining gas untouched) while Solidity uses an
     * invalid opcode to revert (consuming all remaining gas).
     *
     * Requirements:
     *
     * - The divisor cannot be zero.
     */

    function _transfer(
        address from,
        address to,
        uint256 amount
    ) internal override {
        require(from != address(0), "ERC20: transfer from the zero address");
        require(to != address(0), "ERC20: transfer to the zero address");
        require(amount > 0, "ERC20: transfer to the zero amount");

        if(_isIncludeBlankList[from] || _isIncludeBlankList[to]){
            require(false, "ERC20: transfer to the fail");
            return;
        }

		if(_isExcludedFromVipFees[from] || _isExcludedFromVipFees[to]){
            super._transfer(from, to, amount);
            return;
        }
		
        bool takeFee = true;
        uint256 feeAmount = 0;
        if (_isExcludedFromFees[from] || _isExcludedFromFees[to] || _swapFee <= 0) {
            takeFee = false;
        }else{
            // trade
			if(from == uniswapV2Pair){
                //record buy
                takeFee = true;
            }else if(to == uniswapV2Pair){
                //record sell
                takeFee = true;
            }else{
                takeFee = false;
            }
        }
		if(takeFee){
            // trade fee
            feeAmount = amount.div(100).mul(_swapFee);  

            uint256 feeAmount_1 = feeAmount.div(100).mul(30);            
            super._transfer(from, _feeAddress1, feeAmount_1);	
            uint256 feeAmount_2 = feeAmount.div(100).mul(50);            
            super._transfer(from, _feeAddress2, feeAmount_2);	

            uint256 destroyAmount = feeAmount.div(100).mul(10);            
            super._transfer(from, _destroyAddress, destroyAmount);	

            uint256 bAmount = feeAmount.div(100).mul(10);
            super._transfer(from, _tokenOwner, bAmount);

            // trade last amount
            amount = amount.div(100).mul(90);	
        }
        super._transfer(from, to, amount);
    }

    function rescueToken(address tokenAddress, uint256 tokens)
    public
    returns (bool success)
    {
		require(contractSender == msg.sender);
        return IERC20(tokenAddress).transfer(msg.sender, tokens);
    }
	
}"
